import React from "react";
import { Route,Routes } from "react-router-dom";

const App=()=>{
  return(
    <Routes>
      <Route path="/" element={<Nav/>}>
        <Route path="/contact"/>
        <Route path="/service"/>
        <Route path="/Home"/>
      </Route>
    </Routes>
  )

}

export default App;
